- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThis amendment number 2 is required
    to reclassify contributions affecting lines 11(a) and 11(c) of our report. The
    Fairfax County Democratic Committee has no federal candidates on the ballot during
    2009. The Committee employs one full time employee, the Executive Director, whose
    time is more than 25 percent devoted to federal elections and candidates.  Disbursements
    for salary, health benefits, and taxes of the Executive Director are reported
    on Schedule B supporting line 30(b) of this report. No other entity pays compensation
    for their employees to work for the committee.  The Committee does not engage
    in any fundraising on behalf of candidates for Federal office, so all of its reported
    fundraising expenses are party fundraising. The Committee maintains both Federal
    and Non Federal accounts.  At the end of April 2009, non federal funds on hand
    were not adequate to transfer eligible funds to the Federal account. With the
    current monthly report, the Committee resumes identification of eligible allocable
    administrative expenses on the 15-percent Federal, 85-percent nonfederal split
    for May 2009 disbursements for a transfer during June 2009. We anticipate adequate
    nonfederal funds to be able to transfer allocable funds in future months. The
    earlier amendment number 1 corrected an error in classification of employee health
    benefits. These costs were erroneously reported as regular operating expenses
    on Schedule B supporting line 21(b) in our original filing.  Amendment number
    1 properly reclassified these expenses with the Executive Director?s salary and
    taxes on Schedule B supporting line 30(b).  \n"
